                SQLExpr left = binaryOpExpr.getLeft();
                SQLBinaryOperator op = binaryOpExpr.getOperator();
                if (left instanceof SQLIdentifierExpr
                        && op == SQLBinaryOperator.Equality) {
                    String name = ((SQLIdentifierExpr) left).getName();
                    if ("rownum".equals(name)) {
                        print(1);
                        return;
                    }
                }
            }
        }
    }

    if (parameterized) {
        print('?');
        incrementReplaceCount();

        if (this.parameters != null) {
            ExportParameterVisitorUtils.exportParameter(this.parameters, x);
        }
        return;
    }

    if (val < 0 && val >= Long.MAX_VALUE) {
        print(Long.toString(val & 0x7FFFFFFFFFFFFFFFL));
    } else {
        print(val);
